?><p style="font-family: Arial, Verdana, sans-serif; font-size: 12px; text-align: justify;"><span style="color: #333333; font-family: Arial; text-align: left;"><span style="font-size: medium;"><span style="font-family: &quot;Times New Roman&quot;;">Это одна из немногих компаний, название которой, посвящено английской семье. Зарождение этой знаменитой марки датируется 1946-м годом. Немногие знают, что это дочернее предприятие компании Rolex. Ганс Вильдорф (основатель Rolex) пытался максимально извлечь выгоду из вторичного производства корпусов. Изначально все корпуса готовились только для компании Rolex. Но некоторые из них, были модифицированы специально для новой марки Tudor. Эти часы практически всеми характеристиками, начиная с дизайна, и заканчивая функциями, похожи на Rolex. Но, стоит отметить, что различие между этими двумя марками все же имеется. Механизмы в часах Rolex создаются самой компанией, а вот механизмы для Tudor специально закупаются. Но это небольшое различие ни в коем случае не делает качество часов Tudor хуже. Именно поэтому, часы Tudor считаются великолепной альтернативой для тех людей, которые не могут позволить себе часы Rolex. Дизайн Tudor, в большинстве своем, напоминает Rolex. Ассортимент этой компании насчитывает несколько коллекций, среди которых встречаются и мужские, и женские модели. Стоит отметить, что Tudor, помимо обычных часов, выпускает и золотые часы из 18-каратного золота. Помимо этого, все часы имеют различную водонепроницаемость, которая варьируется от 50 до 200 метров.</span></span></span></p>
 
